import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="Budget-App"> 
        <h1 className="text-green-300" >My Budget App</h1>
        <p>My Budget App is a simple web application that allows users to manage their budget.</p>
      </header>
    </div>
  );
}

export default App;
